description:
Extended Validation extends MVC validation to support server side and client side validations of Greater Than, Less Than, Not Equal To, etc. for various data types including DateTime, string, int, long.

Ex: In your model define - 
[Display(Name="Start Date")]
public DateTime Startdate { get; set;  }

[GreaterThan("Startdate")]
Display(Name = "End Date")]
public DateTime Enddate { get; set; }

public int? int1 { get; set; }
[NotEqualTo("int1", ErrorMessage="{0} cannot be equal to {1}")]
public int? int2 { get; set; }

*** Don't forget to include ExtendedValidation.js to your view page available in your Scripts folder once you install the package.

Do you need to integrate OneDrive file access into your Windows Phone 8 app? Instead of starting from scratch with the Live SDK, use the OneDrive browse task to open the current user's files as easily as you request a photo or send an email. Just authenticate your LiveClient, setup the task, and show it:

var t = new SkyDriveBrowserTask{ LiveClient = _liveClient };
t.Completed += SkyDrive_Completed;
t.Show();

Constellation.Html contains a number of extension methods for HtmlTextWriter. Internally these methods use an IDisposable pattern to encapsulate the rather cumbersome code for adding attributes, rendering the begin tag, and rendering the end tag.
		
		The extension methods should generally be called as part of a "using" statement. ex: using (writer.RenderDiv()) { }
		
		The result is C# code for rendering HTML that is very easy to read, fully supports the ASP.NET browser capabilities feature, and is flexible enough to handle new tags invented in the future.
